const Contact = () => (
  <div>
    <h3 className="my-3 header-text-color text-center text-uppercase">
      Get in contact!
    </h3>
    <div className="row">
      <div className="col-3">
        <i class="fa fa-linkedin-square" aria-hidden="true"></i>
      </div>
    </div>
  </div>
);

export default Contact;
